import Card from "./Card";

function CardWrap({ folders }) {
  return (
    <div className="container">
      <div className="container__contentWrap">
        {folders.map((folder) => {
          return <Card folder={folder} />;
        })}
      </div>
    </div>
  );
}

export default CardWrap;
